import React from 'react';

import Button from '../../UserInterface/Buttons/Button/Button';

function WarningLoginNotConfimed(props) {

    return (
        <div className={props.classname}>
            <h2>Введенный login не зарегистрирован в системе</h2>
            <h2>Попробуйте еще раз или обратитесь за помощью к администратору</h2>
            <Button
                onclick={props.onclick}
                icon= 'fa-share-square-o'
                name = 'Повторить'
            />
        </div>

    )
}

export default WarningLoginNotConfimed
